export class ProfileFormModel {
  firstName!: string;
  lastName!: string;
  dateOfBirth?: Date;
  gender!: string;
  phoneNumber!: string;
  email!: string;
  street!: string;
  city!: string;
  zipCode!: string;
  country!: string;
  emergencyContactName!: string;
  emergencyContactRelationship!: string;
  emergencyContactPhoneNumber!: string;
  password!: string;
  confirmPassword!: string;
  roles: string[] = [];
}
